// ==UserScript==
// @name         SSO Background Adder
// @namespace    http://tampermonkey.net/
// @version      1.1
// @description  统一认证登录增加背景图片，快乐面向对象
// @author       Chenrt
// @match        *://sso.buaa.edu.cn/*
// @grant        none
// ==/UserScript==

(function () {
    const defaultOnload = document.body.onload;
    document.body.onload = (param) => {
        if (typeof defaultOnload === 'function') {
            defaultOnload(param);
        } else {
            const sampleBackground = (choices) => choices[Math.floor(Math.random() * choices.length)];
            const updateBackground = (element, choice) => {
                element.style.removeProperty('background');
                element.style.removeProperty('background-image');
                element.style.setProperty('background', 'url(' + choice + ') center/cover no-repeat');
            };
            const choice = sampleBackground([
                'data:image/jpeg;base64,',
                'data:image/jpeg;base64,',
                'data:image/jpeg;base64,',
                'data:image/jpeg;base64,'
            ]);
            const imgSelect = document.getElementById('banner');
            const checkChild = (element) => element && element.childNodes.length > 1;
            if (checkChild(imgSelect) && checkChild(imgSelect.childNodes[1])) {
                let count = 0;
                const interval = setInterval(() => {
                    count < 10 && updateBackground(imgSelect.childNodes[1].childNodes[1], choice);
                    count++ >= 10 && clearInterval(interval);
                }, 100);
            }
        }
    };
})();
